import { View, Text, StyleSheet } from 'react-native'
import React from 'react'

export default function Otp() {
  return (
    <View>
      <Text>Otp</Text>
    </View>
  )
}


const styles = StyleSheet.create({
    container:{
        flex:1
    }
})
